import React from "react";
import "./index.css";
import Element from "./Element";
import dbOptions from "../../dummydb/dbOptions.jsx"
import { Button, MenuItem, TextField } from "@material-ui/core";
export default class Events extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            type: "MidHK1",
            subject: "MATH",
            grade: "12",
            level: "3",
            text: "",
            page: 1
        }
        
    };

    handleChangeType(option){
        this.setState({type:option.target.value});
    };
    render() {
        return (
            <div className="eventsChild">
                <div className="search-bar">
                    <h2>Tìm kiếm</h2>
                    <div>
                        <div className="filter-wrapper">
                            <div className="filter-type">
                                <TextField
                                    name="type"
                                    className="outlined-basic"
                                    variant="outlined"
                                    margin="dense"
                                    fullWidth
                                    select
                                    value={this.state.type}
                                    onChange={this.handleChangeType.bind(this)}
                                >
                                    {dbOptions.types.map((option) => (
                                    <MenuItem key={option.value} value={option.value}>
                                        {option.label}
                                    </MenuItem>
                                    ))}
                                </TextField>
                            </div>

                        </div>
                    </div>
                </div>
                <div><h1>Các nguồn dữ liệu</h1></div>  
                <div className="source-element">
                    
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>     
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>    
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>   
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>   
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>   
                    <div className="element">
                        <Element title="ToanMath.com"></Element>
                    </div>   
                </div>             
                
                <div><h1>Tổng hợp</h1></div>         
            </div>
        )
    }
}
